import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
export const fetcher = url => fetch(url).then(response => response.json()) //fetch ve axios ile veriyi alabiliriz.

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
